class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        ans = 0

        l = []
        for k in range(len(s)):
            for i in range(k, len(s)):
                if s[i] not in l:
                    l.append(s[i])
                else:
                    if ans < len(l):
                        ans = len(l)
                    l = [s[i]]
            if ans < len(l):
                ans = len(l)
            l = []
           
        return ans


